import React, {Component} from 'react';
import "./_header.scss"
import LogRegister from "./log_register/LogRegister";

class Header extends Component
{
    render() {
        return (
            <>
                <header className="header">
                    <LogRegister/>
                </header>
            </>
        )
    }
}

export default Header;
